    cs: "Loading...",
    da: "❌ Denne undersøgelse er inkompatibel med den vedhæftede MMM, der kører BBB 111 under OOO 222, men du kan opgradere dens OS og/eller skifte til en Chrome-browser og prøve igen.",
    nl: "❌ Deze studie is niet compatibel met de bijgevoegde MMM met BBB 111 onder OOO 222, maar u kunt het besturingssysteem upgraden en/of overschakelen naar een Chrome-browser en het opnieuw proberen.",
    "en-UK":
      "❌ This study is incompatible with the attached MMM running BBB 111 under OOO 222, but you could upgrade its OS and/or switch to a Chrome browser, and try again.",
    fi: "❌ Tämä tutkimus ei ole yhteensopiva liitetyn MMM:n kanssa, joka käyttää BBB 111:tä OOO 222:n alla, mutta voit päivittää sen käyttöjärjestelmän ja/tai vaihtaa Chrome-selaimeen ja yrittää uudelleen.",
    fr: "Cette étude est incompatible avec le MMM joint fonctionnant sous BBB 111 sur OOO 222, mais vous pourriez mettre à jour son système d'exploitation et/ou passer à un navigateur Chrome, puis réessayer.",
    de: "❌ Diese Studie ist nicht mit dem angeschlossenen MMM kompatibel, auf dem BBB 111 unter OOO 222 ausgeführt wird. Sie können jedoch das Betriebssystem aktualisieren und/oder zu einem Chrome-Browser wechseln und es erneut versuchen.",
    el: "❌ Αυτή η μελέτη δεν είναι συμβατή με το συνημμένο MMM που εκτελεί BBB 111 κάτω από το OOO 222, αλλά θα μπορούσατε να αναβαθμίσετε το λειτουργικό σύστημα ή/και να μεταβείτε σε πρόγραμμα περιήγησης Chrome και να προσπαθήσετε ξανά.",
    he: "Loading...",
    hi: "Loading...",
    hu: "❌ Ez a tanulmány nem kompatibilis a mellékelt MMM-mel, amelyen a BBB 111 az OOO 222 alatt fut, de frissítheti az operációs rendszerét és/vagy válthat Chrome böngészőre, majd próbálja újra.",
    is: "❌ Þessi rannsókn er ósamrýmanleg meðfylgjandi MMM sem keyrir BBB 111 undir OOO 222, en þú gætir uppfært stýrikerfið og/eða skipt yfir í Chrome vafra og reynt aftur.",
