    no: "DDDD-nettleseren, BBBB 1111, støtter ikke nødvendige funksjon(er) FFFF. Du kan løse dette ved å bytte til en nyere versjon av denne nettleseren eller bytte til Chrome. For en liste over funksjonskompatible nettlesere, søk etter en funksjon på https://developer.mozilla.org/ og se kompatibilitetstabellen nederst på siden.",
