    hi: 'आपका कंप्यूटर. हमें इसके ब्रांड और मॉडल को निर्दिष्ट करने वाले विवरण की आवश्यकता है। "सिस्टम सूचना" ढूंढें। मॉडल का नाम और नंबर नीचे संबंधित फ़ील्ड में कॉपी करें।',
    hu: "Loading...",
    is: 'TÖLVAN ÞÍN. Við þurfum upplýsingar um vörumerki þess og gerð. Finndu "System Information". Afritaðu heiti líkans og númer í samsvarandi reiti hér að neðan.',
    id: 'KOMPUTER ANDA. Kami memerlukan detail yang menentukan merek dan modelnya. Temukan "Informasi Sistem". Salin Nama dan nomor model ke kolom terkait di bawah.',
    it: 'IL TUO COMPUTER. Abbiamo bisogno di dettagli che specifichino la marca e il modello. Trova "Informazioni di sistema". Copia il nome e il numero del modello nei campi corrispondenti qui sotto.',
    ja: "Loading...",
    kn: 'ನಿಮ್ಮ ಕಂಪ್ಯೂಟರ್. ಅದರ ಬ್ರ್ಯಾಂಡ್ ಮತ್ತು ಮಾದರಿಯನ್ನು ನಿರ್ದಿಷ್ಟಪಡಿಸುವ ವಿವರಗಳು ನಮಗೆ ಅಗತ್ಯವಿದೆ. "ಸಿಸ್ಟಮ್ ಮಾಹಿತಿ" ಅನ್ನು ಹುಡುಕಿ. ಕೆಳಗಿನ ಅನುಗುಣವಾದ ಕ್ಷೇತ್ರಗಳಿಗೆ ಮಾದರಿ ಹೆಸರು ಮತ್ತು ಸಂಖ್ಯೆಯನ್ನು ನಕಲಿಸಿ.',
    ko: '귀하의 컴퓨터. 브랜드와 모델을 지정하는 세부정보가 필요합니다. "시스템 정보"를 찾으세요. 모델 이름과 번호를 아래 해당 필드에 복사하세요.',
    lt: 'JŪSŲ KOMPIUTERIS. Mums reikia išsamios informacijos apie prekės ženklą ir modelį. Raskite "Sistemos informacija". Nukopijuokite modelio pavadinimą ir numerį į atitinkamus toliau pateiktus laukus.',
    ms: 'KOMPUTER ANDA. Kami memerlukan butiran yang menyatakan jenama dan modelnya. Cari "Maklumat Sistem". Salin nama dan nombor Model ke medan yang sepadan di bawah.',
    ml: "Loading...",
    no: "Loading...",
    fa: 'کامپیوتر شما به جزئیاتی نیاز داریم که برند و مدل آن را مشخص کند. "اطلاعات سیستم" را پیدا کنید. نام و شماره مدل را در فیلدهای مربوطه در زیر کپی کنید.',
    pl: "Loading...",
    pt: "Loading...",
    ro: "CALCULATORUL TĂU. Avem nevoie de detalii care să precizeze marca și modelul acestuia. Găsiți „Informații de sistem”. Copiați numele și numărul modelului în câmpurile corespunzătoare de mai jos.",
