    sw: "Loading...",
    sv: "Loading...",
    tl: 'IYONG COMPUTER. Kailangan namin ng mga detalyeng tumutukoy sa tatak at modelo nito. Hanapin ang "Impormasyon ng System". Kopyahin ang pangalan at numero ng Modelo sa mga kaukulang field sa ibaba.',
    tr: 'BİLGİSAYARINIZ. Marka ve modelini belirten detaylara ihtiyacımız var. "Sistem Bilgileri"ni bulun. Model adını ve numarasını aşağıdaki ilgili alanlara kopyalayın.',
    ur: 'آپ کا کمپیوٹر۔ ہمیں اس کے برانڈ اور ماڈل کی تفصیلات کی ضرورت ہے۔ "سسٹم کی معلومات" تلاش کریں۔ ماڈل کا نام اور نمبر نیچے دیے گئے متعلقہ فیلڈز میں کاپی کریں۔',
