    fi: "Loading...",
    fr: "VOTRE TÉLÉPHONE. Nous avons besoin de détails précisant sa marque et son modèle. Allez dans le menu Paramètres ou Options, faites défiler jusqu'en bas de la liste et cliquez sur 'Système', 'À propos du téléphone', 'À propos de l'appareil' ou similaire. Copiez le nom et le numéro du modèle dans les champs correspondants ci-dessous.",
    de: "Loading...",
    el: "ΤΟ ΤΗΛΕΦΩΝΟ ΣΑΣ. Χρειαζόμαστε λεπτομέρειες που να προσδιορίζουν τη μάρκα και το μοντέλο του. Μεταβείτε στο μενού Ρυθμίσεις ή Επιλογές, κάντε κύλιση στο κάτω μέρος της λίστας και κάντε κλικ στο «Σύστημα», «Σχετικά με το τηλέφωνο», «Σχετικά με τη συσκευή» ή παρόμοια. Αντιγράψτε το όνομα και τον αριθμό μοντέλου στα αντίστοιχα πεδία παρακάτω.",
    he: "Loading...",
    hi: "Loading...",
    hu: "A TELEFONOD. A márkát és a modellt meghatározó részletekre van szükségünk. Lépjen a Beállítások vagy Beállítások menübe, görgessen a lista aljára, és kattintson a „Rendszer”, „A telefonról”, „Az eszközről” vagy hasonló lehetőségre. Másolja a modell nevét és számát az alábbi megfelelő mezőkbe.",
    is: "Loading...",
    id: "TELEPON ANDA. Kami memerlukan detail yang menentukan merek dan modelnya. Buka menu Pengaturan atau Opsi, gulir ke bagian bawah daftar, dan klik 'Sistem', 'Tentang ponsel', 'Tentang perangkat' atau sejenisnya. Salin Nama dan nomor model ke kolom terkait di bawah.",
    it: "IL TUO TELEFONO. Abbiamo bisogno di dettagli che specifichino la marca e il modello. Vai al menu Impostazioni o Opzioni, scorri fino in fondo all'elenco e clicca su 'Sistema', 'Informazioni sul telefono', 'Informazioni sul dispositivo' o simili. Copia il nome e il numero del modello nei campi corrispondenti qui sotto.",
    ja: "あなたの電話。ブランドとモデルを特定する詳細が必要です。 [設定] または [オプション] メニューに移動し、リストの一番下までスクロールして、[システム]、[電話情報]、[デバイス情報] などをクリックします。モデル名と番号を以下の対応するフィールドにコピーします。",
    kn: "Loading...",
    ko: "Loading...",
    lt: "Loading...",
    ms: "Loading...",
    ml: "നിങ്ങളുടെ ഫോൺ. അതിൻ്റെ ബ്രാൻഡും മോഡലും വ്യക്തമാക്കുന്ന വിശദാംശങ്ങൾ ഞങ്ങൾക്ക് ആവശ്യമാണ്. ക്രമീകരണങ്ങൾ അല്ലെങ്കിൽ ഓപ്‌ഷനുകൾ മെനുവിലേക്ക് പോകുക, ലിസ്റ്റിൻ്റെ താഴേക്ക് സ്ക്രോൾ ചെയ്യുക, തുടർന്ന് 'സിസ്റ്റം', 'ഫോണിനെക്കുറിച്ച്', 'ഉപകരണത്തെക്കുറിച്ച്' അല്ലെങ്കിൽ സമാനമായത് ക്ലിക്ക് ചെയ്യുക. ചുവടെയുള്ള അനുബന്ധ ഫീൽഡുകളിലേക്ക് മോഡലിൻ്റെ പേരും നമ്പറും പകർത്തുക.",
    no: 'DIN TELEFON. Vi trenger detaljer som spesifiserer merke og modell. Gå til menyen Innstillinger eller Alternativer, bla til bunnen av listen og klikk "System", "Om telefonen", "Om enheten" eller lignende. Kopier modellnavnet og -nummeret til de tilsvarende feltene nedenfor.',
    fa: "Loading...",
    pl: "TWÓJ TELEFON. Potrzebujemy szczegółów określających jego markę i model. Przejdź do menu Ustawienia lub Opcje, przewiń listę w dół i kliknij „System”, „Informacje o telefonie”, „Informacje o urządzeniu” lub podobne. Skopiuj nazwę i numer modelu do odpowiednich pól poniżej.",
    pt: "SEU TELEFONE. Precisamos de detalhes especificando sua marca e modelo. Vá para o menu Configurações ou Opções, role até o final da lista e clique em ‘Sistema’, ‘Sobre o telefone’, ‘Sobre o dispositivo’ ou similar. Copie o nome e o número do modelo nos campos correspondentes abaixo.",
    ro: "Loading...",
    ru: "ВАШ ТЕЛЕФОН. Нам нужны подробности с указанием его марки и модели. Перейдите в меню «Настройки» или «Параметры», прокрутите список вниз и нажмите «Система», «О телефоне», «Об устройстве» или аналогичный. Скопируйте название и номер модели в соответствующие поля ниже.",
    sr: "Loading...",
    es: "TU TELÉFONO. Necesitamos detalles que especifiquen su marca y modelo. Ve al menú de Configuración u Opciones, desplázate hasta el final de la lista y haz clic en 'Sistema', 'Acerca del teléfono', 'Acerca del dispositivo' o similar. Copia el nombre y número del modelo en los campos correspondientes a continuación.",
    sw: "SIMU YAKO. Tunahitaji maelezo yanayobainisha chapa na muundo wake. Nenda kwenye menyu ya Mipangilio au Chaguzi, sogeza hadi chini ya orodha, na ubofye 'Mfumo', 'Kuhusu simu', 'Kuhusu kifaa' au sawa. Nakili jina la Mfano na nambari kwenye sehemu zinazolingana hapa chini.",
    sv: 'DIN TELEFON. Vi behöver detaljer som anger dess märke och modell. Gå till menyn Inställningar eller Alternativ, scrolla till botten av listan och klicka på "System", "Om telefonen", "Om enheten" eller liknande. Kopiera modellnamn och nummer till motsvarande fält nedan.',
    tl: "Loading...",
    tr: "Loading...",
    ur: "آپ کا فون۔ ہمیں اس کے برانڈ اور ماڈل کی تفصیلات کی ضرورت ہے۔ ترتیبات یا اختیارات کے مینو پر جائیں، فہرست کے نیچے سکرول کریں، اور 'سسٹم'، 'فون کے بارے میں'، 'آلہ کے بارے میں' یا اسی طرح پر کلک کریں۔ ماڈل کا نام اور نمبر نیچے دیے گئے متعلقہ فیلڈز میں کاپی کریں۔",
