    ar: 'هاتف Android الخاص بك. نحتاج إلى تفاصيل تحدد علامته التجارية وطرازه. انتقل إلى الإعدادات > حول الهاتف أو الإعدادات > النظام > حول الهاتف (سابقًا "حول الجهاز"). انسخ اسم المنتج أو الجهاز أو الطراز ورقم الطراز إلى حقول اسم الطراز ورقم الطراز أدناه.',
