    hi: 'आपका बड़ा फ़ोन. हमें इसके मॉडल को निर्दिष्ट करने वाले विवरण की आवश्यकता है। सेटिंग्स > फ़ोन के बारे में (पूर्व में "डिवाइस के बारे में") पर जाएँ। मॉडल नाम और संख्या को नीचे संबंधित फ़ील्ड में कॉपी करें।',
