    ko: "귀하의 바다 휴대폰. 모델을 지정하는 세부정보가 필요합니다. 설정 > 휴대전화 정보(이전의 '기기 정보')로 이동하세요. 모델 이름과 번호를 아래 해당 필드에 복사하세요.",
    lt: "JŪSŲ Bada TELEFONAS. Mums reikia detalių, nurodančių jos modelį. Eikite į „Nustatymai“ > „Apie telefoną“ (anksčiau „Apie įrenginį“). Nukopijuokite modelio pavadinimą ir numerį į atitinkamus toliau pateiktus laukus.",
    ms: 'TELEFON Bada ANDA. Kami memerlukan butiran yang menyatakan modelnya. Pergi ke Tetapan > Perihal telefon (dahulunya "Perihal peranti"). Salin Nama Model dan Nombor ke medan yang sepadan di bawah.',
    ml: 'നിങ്ങളുടെ ബഡാ ഫോൺ. അതിൻ്റെ മാതൃക വ്യക്തമാക്കുന്ന വിശദാംശങ്ങൾ ഞങ്ങൾക്ക് ആവശ്യമാണ്. ക്രമീകരണങ്ങൾ > ഫോണിനെക്കുറിച്ച് (മുമ്പ് "ഉപകരണത്തെക്കുറിച്ച്") എന്നതിലേക്ക് പോകുക. ചുവടെയുള്ള അനുബന്ധ ഫീൽഡുകളിലേക്ക് മോഡലിൻ്റെ പേരും നമ്പറും പകർത്തുക.',
    no: "DIN Bada-TELEFON. Vi trenger detaljer som spesifiserer modellen. Gå til Innstillinger > Om telefonen (tidligere «Om enheten»). Kopier modellnavnet og -nummeret til de tilsvarende feltene nedenfor.",
    fa: "تلفن بادا شما. ما به جزئیاتی نیاز داریم که مدل آن را مشخص کند. به تنظیمات > درباره تلفن (قبلاً «درباره دستگاه») بروید. نام و شماره مدل را در فیلدهای مربوطه در زیر کپی کنید.",
