    ro: "Loading...",
    ru: "Loading...",
    sr: "Loading...",
    es: 'TU TELÉFONO Bada. Necesitamos detalles que especifiquen su modelo. Ve a Configuración > Acerca del teléfono (anteriormente "Acerca del dispositivo"). Copia el Nombre y Número del Modelo en los campos correspondientes a continuación.',
