    de: "Loading...",
    el: "Loading...",
    he: 'טלפון Firefox שלך. אנחנו צריכים פרטים המפרטים את הדגם שלו. עבור אל הגדרות > מידע על הטלפון (לשעבר "אודות המכשיר"). העתק את שם הדגם והמספר לשדות המתאימים למטה.',
    hi: 'आपका फ़ायरफ़ॉक्स फ़ोन। हमें इसके मॉडल को निर्दिष्ट करने वाले विवरण की आवश्यकता है। सेटिंग्स > फ़ोन के बारे में (पूर्व में "डिवाइस के बारे में") पर जाएँ। मॉडल का नाम और नंबर नीचे संबंधित फ़ील्ड में कॉपी करें।',
    hu: "Loading...",
    is: "Loading...",
    id: 'TELEPON Firefox ANDA. Kami memerlukan detail yang menentukan modelnya. Buka Pengaturan > Tentang ponsel (sebelumnya "Tentang perangkat"). Salin Nama dan nomor model ke kolom terkait di bawah.',
    it: 'IL TUO TELEFONO Firefox. Abbiamo bisogno di dettagli che specifichino il suo modello. Vai su Impostazioni > Info sul telefono (precedentemente "Info sul dispositivo"). Copia il nome e il numero del modello nei campi corrispondenti qui sotto.',
    ja: "Loading...",
    kn: 'ನಿಮ್ಮ Firefox ಫೋನ್. ಅದರ ಮಾದರಿಯನ್ನು ನಿರ್ದಿಷ್ಟಪಡಿಸುವ ವಿವರಗಳು ನಮಗೆ ಅಗತ್ಯವಿದೆ. ಸೆಟ್ಟಿಂಗ್‌ಗಳು > ಫೋನ್ ಕುರಿತು (ಹಿಂದೆ "ಸಾಧನದ ಕುರಿತು") ಗೆ ಹೋಗಿ. ಕೆಳಗಿನ ಅನುಗುಣವಾದ ಕ್ಷೇತ್ರಗಳಿಗೆ ಮಾದರಿ ಹೆಸರು ಮತ್ತು ಸಂಖ್ಯೆಯನ್ನು ನಕಲಿಸಿ.',
    ko: "귀하의 Firefox 휴대폰. 모델을 지정하는 세부정보가 필요합니다. 설정 > 휴대전화 정보(이전의 '기기 정보')로 이동하세요. 모델 이름과 번호를 아래 해당 필드에 복사하세요.",
    lt: "JŪSŲ Firefox TELEFONAS. Mums reikia detalių, nurodančių jos modelį. Eikite į „Nustatymai“ > „Apie telefoną“ (anksčiau „Apie įrenginį“). Nukopijuokite modelio pavadinimą ir numerį į atitinkamus toliau pateiktus laukus.",
    ms: 'TELEFON Firefox ANDA. Kami memerlukan butiran yang menyatakan modelnya. Pergi ke Tetapan > Perihal telefon (dahulunya "Perihal peranti"). Salin nama dan nombor Model ke medan yang sepadan di bawah.',
    ml: "Loading...",
    no: "Loading...",
    fa: "تلفن فایرفاکس شما. ما به جزئیاتی نیاز داریم که مدل آن را مشخص کند. به تنظیمات > درباره تلفن (قبلاً «درباره دستگاه») بروید. نام و شماره مدل را در فیلدهای مربوطه در زیر کپی کنید.",
    pl: "Loading...",
    pt: "Loading...",
    ro: "Loading...",
    ru: "Loading...",
    sr: "Loading...",
    es: 'TU TELÉFONO Firefox. Necesitamos detalles que especifiquen su modelo. Ve a Configuración > Acerca del teléfono (anteriormente "Acerca del dispositivo"). Copia el nombre y número del modelo en los campos correspondientes a continuación.',
    sw: "Loading...",
