    tl: 'IYONG Firefox PHONE. Kailangan namin ng mga detalye na tumutukoy sa modelo nito. Pumunta sa Mga Setting > Tungkol sa telepono (dating "Tungkol sa device"). Kopyahin ang pangalan at numero ng Modelo sa mga kaukulang field sa ibaba.',
    tr: 'Firefox TELEFONUNUZ. Modelini belirten ayrıntılara ihtiyacımız var. Ayarlar > Telefon hakkında (eski adıyla "Cihaz hakkında") seçeneğine gidin. Model adını ve numarasını aşağıdaki ilgili alanlara kopyalayın.',
    ur: 'آپ کا فائر فاکس فون۔ ہمیں اس کے ماڈل کی تفصیلات کی ضرورت ہے۔ ترتیبات > فون کے بارے میں (پہلے "آلہ کے بارے میں") پر جائیں۔ ماڈل کا نام اور نمبر نیچے دیے گئے متعلقہ فیلڈز میں کاپی کریں۔',
