    sw: "Loading...",
    sv: "Loading...",
    tl: "1. Ang computer na ito ay may 111 (mga) camera. \n2. Sinusubaybayan ng pag-aaral na ito ang titig o distansya ng pagtingin, kung saan kailangan nito ng camera sa tuktok na gilid ng screen, kaya mangyaring pumili ng screen na may top-edge na camera. \n3. Paki-drag ang window na ito sa alinmang screen na gusto mong gamitin para sa pag-aaral na ito.\n4. Sapat na ang halos nasa screen na iyon.\n5. Pagkatapos ay i-click ang PROCEED o pindutin ang RETURN.",
