    "en-US":
      "Look at the middle of the top edge of this screen, and click the video feed that shows you looking directly at the camera. You can change your mind. Once you’re sure, click PROCEED or press RETURN.",
    ar: "انظر إلى منتصف الحافة العلوية لهذه الشاشة، وانقر على الفيديو الذي يظهر أنك تنظر مباشرة إلى الكاميرا. يمكنك تغيير رأيك. بمجرد أن تكون متأكدًا، انقر على متابعة أو اضغط على إدخال.",
    hy: "Նայեք այս էկրանի վերին եզրի կեսին և սեղմեք տեսանյութի հոսքը, որը ցույց է տալիս, որ դուք ուղղակիորեն նայում եք տեսախցիկին: Դուք կարող եք փոխել ձեր միտքը: Երբ համոզվեք, սեղմեք ՇԱՐՈՒՆԱԿԵԼ կամ սեղմեք ՎԵՐԱԴԱՐՁ:",
    bg: "Погледнете в средата на горния край на този екран и щракнете върху видео емисия, която показва, че гледате директно към камерата. Можете да промените решението си. След като сте сигурни, щракнете върху ПРОДЪЛЖИ или натиснете RETURN.",
    "zh-CN":
      "查看此屏幕上边缘的中间，然后单击显示您直视相机的视频源。你可以改变主意。确定后，单击“继续”或按“返回”。",
    "zh-HK": "Loading...",
    hr: "Loading...",
    cs: "Podívejte se doprostřed horního okraje této obrazovky a klikněte na video, které ukazuje, že se díváte přímo do kamery. Můžete změnit názor. Jakmile si budete jisti, klikněte na POKRAČOVAT nebo stiskněte RETURN.",
    da: "Loading...",
    nl: "Kijk naar het midden van de bovenrand van dit scherm en klik op de videofeed waarin je rechtstreeks in de camera kijkt. Je kunt van gedachten veranderen. Als u het zeker weet, klikt u op DOORGAAN of drukt u op RETURN.",
    "en-UK":
      "Look at the middle of the top edge of this screen, and click the video feed that shows you looking directly at the camera. You can change your mind. Once you’re sure, click PROCEED or press RETURN.",
    fi: "Loading...",
    fr: "Regardez le milieu du bord supérieur de cet écran et cliquez sur le flux vidéo qui vous montre en train de regarder directement la caméra. Vous pouvez changer d'avis. Une fois que vous êtes sûr, cliquez sur PROCÉDER ou appuyez sur RETOUR.",
    de: "Loading...",
    el: "Loading...",
    he: "Loading...",
    hi: "Loading...",
    hu: "Loading...",
    is: "Loading...",
    id: "Lihat bagian tengah tepi atas layar ini, dan klik feed video yang menunjukkan Anda melihat langsung ke kamera. Anda bisa berubah pikiran. Setelah yakin, klik PROCEED atau tekan RETURN.",
    it: "Guarda al centro del bordo superiore di questo schermo e clicca sul feed video che ti mostra guardando direttamente la fotocamera. Puoi cambiare idea. Una volta sicuro, clicca su PROSEGUI o premi INVIO.",
    ja: "この画面の上端の中央に注目し、カメラを直接見つめているビデオ フィードをクリックします。考えを変えることもできます。確認したら、「続行」をクリックするか、「Return」を押してください。",
    kn: "Loading...",
    ko: "Loading...",
    lt: "Loading...",
    ms: "Lihat bahagian tengah tepi atas skrin ini, dan klik suapan video yang menunjukkan anda melihat terus ke kamera. Anda boleh mengubah fikiran anda. Setelah anda pasti, klik PROCEED atau tekan RETURN.",
    ml: "ഈ സ്‌ക്രീനിൻ്റെ മുകൾ ഭാഗത്തിൻ്റെ മധ്യഭാഗത്തേക്ക് നോക്കുക, നിങ്ങൾ നേരിട്ട് ക്യാമറയിലേക്ക് നോക്കുന്നത് കാണിക്കുന്ന വീഡിയോ ഫീഡിൽ ക്ലിക്ക് ചെയ്യുക. നിങ്ങൾക്ക് മനസ്സ് മാറ്റാം. നിങ്ങൾക്ക് ഉറപ്പായിക്കഴിഞ്ഞാൽ, തുടരുക ക്ലിക്ക് ചെയ്യുക അല്ലെങ്കിൽ റിട്ടേൺ അമർത്തുക.",
    no: "Se på midten av den øvre kanten av denne skjermen, og klikk på videofeeden som viser at du ser direkte på kameraet. Du kan ombestemme deg. Når du er sikker, klikk FORTSETT eller trykk RETURN.",
    fa: "Loading...",
    pl: "Loading...",
    pt: "Olhe para o meio da borda superior desta tela e clique no feed de vídeo que mostra você olhando diretamente para a câmera. Você pode mudar de ideia. Quando tiver certeza, clique em PROCEDER ou pressione RETURN.",
    ro: "Loading...",
    ru: "Посмотрите на середину верхнего края этого экрана и нажмите на видеопоток, на котором показано, как вы смотрите прямо в камеру. Вы можете передумать. Если вы уверены, нажмите ПРОДОЛЖИТЬ или нажмите ВОЗВРАТ.",
    sr: "Loading...",
    es: "Mira el centro del borde superior de esta pantalla y haz clic en la transmisión de video que te muestra mirando directamente a la cámara. Puedes cambiar de opinión. Una vez que estés seguro, haz clic en PROCEED o presiona RETURN.",
    sw: "Angalia katikati ya ukingo wa juu wa skrini hii, na ubofye mpasho wa video unaoonyesha ukitazama moja kwa moja kwenye kamera. Unaweza kubadilisha mawazo yako. Mara tu unapohakikisha, bofya ENDELEA au ubofye RETURN.",
    sv: "Titta på mitten av den övre kanten av den här skärmen och klicka på videoflödet som visar att du tittar direkt på kameran. Du kan ändra dig. När du är säker klickar du på FORTSÄTT eller trycker på RETURN.",
