    "zh-HK": "Loading...",
    hr: "1. Izmjerite, u centimetrima, širinu i visinu svjetlećeg zaslona.\n2. Izmjerite svaku marginu — lijevu, desnu, gornju i donju — od ruba zaslona do fizičkog ruba monitora.\n3. Izmjerite visinu od stola do donjeg ruba monitora. To je donji rub margine.",
    cs: "1. Změřte v centimetrech šířku a výšku zářící obrazovky.\n2. Změřte každý okraj – levý, pravý, horní a dolní – od okraje obrazovky k fyzickému okraji monitoru.\n3. Změřte výšku od stolu ke spodnímu okraji monitoru. To je spodní okraj okraje.",
    da: "1. Mål bredden og højden af ​​den glødende skærm i centimeter.\n2. Mål hver margen — Venstre, Højre, Top og Bund — fra kanten af ​​skærmen til den fysiske kant af skærmen.\n3. Mål højden fra bordet op til skærmens nederste kant. Det er den nederste kant af marginen.",
    nl: "Loading...",
    "en-UK":
      "1. Measure, in centimetres, the Width and Height of the glowing screen. 2. Measure each margin — Left, Right, Top, and Bottom — from the edge of the screen to the physical edge of the monitor. 3. Measure elevation from table up to bottom edge of monitor. That's the bottom edge of the margin.",
    fi: "Loading...",
    fr: "1. Mesurez, en centimètres, la largeur et la hauteur de l'écran lumineux.\n2. Mesurez chaque marge — gauche, droite, haut et bas — du bord de l'écran au bord physique du moniteur.\n3. Mesurez l'élévation de la table jusqu'au bord inférieur du moniteur. C'est le bord inférieur de la marge.",
    de: "Loading...",
    el: "Loading...",
    he: "1. מדוד, בסנטימטרים, את הרוחב והגובה של המסך הזוהר.\n2. מדוד כל שוליים - שמאל, ימין, עליון ותחתון - מקצה המסך ועד לקצה הפיזי של הצג.\n3. מדוד גובה מהשולחן עד לקצה התחתון של הצג. זה הקצה התחתון של השוליים.",
    hi: "1. चमकती स्क्रीन की चौड़ाई और ऊंचाई सेंटीमीटर में मापें।\n2. स्क्रीन के किनारे से मॉनिटर के भौतिक किनारे तक प्रत्येक मार्जिन - बाएँ, दाएँ, ऊपर और नीचे - को मापें।\n3. टेबल से मॉनिटर के निचले किनारे तक की ऊंचाई मापें। वह मार्जिन का निचला किनारा है।",
    hu: "Loading...",
    is: "Loading...",
    id: "1. Ukur, dalam sentimeter, Lebar dan Tinggi layar bercahaya.\n2. Ukur setiap margin — Kiri, Kanan, Atas, dan Bawah — dari tepi layar hingga tepi fisik monitor.\n3. Ukur ketinggian dari meja hingga tepi bawah monitor. Itu adalah tepi bawah margin.",
    it: "1. Misura, in centimetri, la Larghezza e l'Altezza dello schermo luminoso.\n2. Misura ogni margine — Sinistro, Destro, Superiore e Inferiore — dal bordo dello schermo al bordo fisico del monitor.\n3. Misura l'elevazione dal tavolo fino al bordo inferiore del monitor. Questo è il bordo inferiore del margine.",
    ja: "Loading...",
    kn: "¡Buen trabajo! Por favor, tómate un momento para relajarte y parpadear.",
    ko: "1. 빛나는 화면의 너비와 높이를 센티미터 단위로 측정합니다.\n2. 화면 가장자리부터 모니터의 실제 가장자리까지 왼쪽, 오른쪽, 위쪽, 아래쪽의 각 여백을 측정합니다.\n3. 테이블에서 모니터 하단 가장자리까지 높이를 측정합니다. 이것이 여백의 아래쪽 가장자리입니다.",
    lt: "1. Išmatuokite švytinčio ekrano plotį ir aukštį centimetrais.\n2. Išmatuokite kiekvieną paraštę – kairę, dešinę, viršutinę ir apatinę – nuo ​​ekrano krašto iki fizinio monitoriaus krašto.\n3. Išmatuokite aukštį nuo stalo iki apatinio monitoriaus krašto. Tai apatinis paraštės kraštas.",
    ms: "1. Ukur, dalam sentimeter, Lebar dan Tinggi skrin bercahaya.\n2. Ukur setiap jidar — Kiri, Kanan, Atas dan Bawah — dari pinggir skrin ke tepi fizikal monitor.\n3. Ukur ketinggian dari meja ke atas ke tepi bawah monitor. Itulah tepi bawah jidar.",
    ml: "Loading...",
    no: "Loading...",
    fa: "1. عرض و ارتفاع صفحه درخشان را بر حسب سانتی متر اندازه بگیرید.\n2. هر حاشیه - چپ، راست، بالا و پایین - را از لبه صفحه تا لبه فیزیکی مانیتور اندازه بگیرید.\n3. ارتفاع از میز تا لبه پایین نمایشگر را اندازه گیری کنید. این لبه پایینی حاشیه است.",
    pl: "Loading...",
    pt: "Loading...",
    ro: "Loading...",
    ru: "Loading...",
    sr: "1. Измерите, у центиметрима, ширину и висину светлећег екрана.\n2. Измерите сваку маргину — леву, десну, горњу и доњу — од ивице екрана до физичке ивице монитора.\n3. Измерите висину од стола до доње ивице монитора. То је доња ивица маргине.",
    es: "1. Mide, en centímetros, el Ancho y la Altura de la pantalla luminosa.\n2. Mide cada margen — Izquierdo, Derecho, Superior e Inferior — desde el borde de la pantalla hasta el borde físico del monitor.\n3. Mide la elevación desde la mesa hasta el borde inferior del monitor. Ese es el borde inferior del margen.",
    sw: "Loading...",
    sv: "Loading...",
    tl: "1. Sukatin, sa sentimetro, ang Lapad at Taas ng kumikinang na screen.\n2. Sukatin ang bawat margin — Kaliwa, Kanan, Itaas, at Ibaba — mula sa gilid ng screen hanggang sa pisikal na gilid ng monitor.\n3. Sukatin ang elevation mula sa talahanayan hanggang sa ibabang gilid ng monitor. Iyon ang ilalim na gilid ng margin.",
