    fi: "Loading...",
    fr: "Connexion perdue. Reconnectez-vous en actualisant cette page. Pour actualiser, appuyez simplement sur l'icône d'actualisation ⟳ dans la barre d'adresse. Ou appuyez sur l'adresse et appuyez sur RETOUR. Ou appuyez sur “…” ou “⋮“ dans la barre de menu pour obtenir un menu déroulant, et sélectionnez “Actualiser” ou “Recharger”.",
    de: "Loading...",
    el: "Η σύνδεση χάθηκε. Επανασυνδεθείτε ανανεώνοντας αυτήν τη σελίδα. Για ανανέωση, απλώς πατήστε το εικονίδιο ανανέωσης ⟳ στη γραμμή διευθύνσεων. Ή πατήστε τη διεύθυνση και πατήστε ΕΠΙΣΤΡΟΦΗ. Ή πατήστε «…» ή «⋮» στη γραμμή μενού για να λάβετε ένα αναπτυσσόμενο μενού και από αυτό επιλέξτε «Ανανέωση» ή «Επαναφόρτωση».",
    he: "Loading...",
    hi: "Loading...",
    hu: "Megszakadt a kapcsolat. Csatlakozzon újra az oldal frissítésével. A frissítéshez koppintson a frissítés ikonra ⟳ a címsávban. Vagy érintse meg a címet, és nyomja meg a RETURN gombot. Vagy érintse meg a „…” vagy a „⋮” gombot a menüsorban, hogy egy legördülő menüt kapjon, és válassza ki a „Frissítés” vagy az „Újratöltés” ​​lehetőséget.",
    is: "Loading...",
    id: "Koneksi terputus. Hubungkan kembali dengan menyegarkan halaman ini. Untuk menyegarkan, cukup ketuk ikon segarkan ⟳ di bilah alamat. Atau ketuk alamatnya dan tekan KEMBALI. Atau ketuk “…” atau “⋮” di bilah menu untuk mendapatkan menu tarik-turun, dan dari situ pilih “Segarkan” atau “Muat Ulang”.",
    it: "Connessione persa. Riconnettiti aggiornando questa pagina. Per aggiornare, tocca semplicemente l'icona di aggiornamento ⟳ nella barra degli indirizzi. Oppure tocca l'indirizzo e premi INVIO. Oppure tocca “…” o “⋮“ nella barra del menu per ottenere un menu a discesa e da lì seleziona “Aggiorna” o “Ricarica”.",
    ja: "接続が失われました。このページを更新して再接続します。更新するには、アドレスバーの更新アイコン ⟳ をタップするだけです。または、アドレスをタップして「戻る」を押します。または、メニュー バーで「…」または「⋮」をタップしてドロップダウン メニューを表示し、そこから「更新」または「再読み込み」を選択します。",
