    ml: "കണക്ഷൻ നഷ്ടപ്പെട്ടു. ഈ പേജ് പുതുക്കി വീണ്ടും ബന്ധിപ്പിക്കുക. പുതുക്കാൻ, വിലാസ ബാറിലെ പുതുക്കൽ ഐക്കൺ ⟳ ടാപ്പ് ചെയ്യുക. അല്ലെങ്കിൽ വിലാസം ടാപ്പുചെയ്‌ത് RETURN അമർത്തുക. അല്ലെങ്കിൽ ഒരു ഡ്രോപ്പ്-ഡൗൺ മെനു ലഭിക്കാൻ മെനു ബാറിലെ “…” അല്ലെങ്കിൽ “⋮“ ടാപ്പുചെയ്യുക, അതിൽ നിന്ന് “പുതുക്കുക” അല്ലെങ്കിൽ “റീലോഡ്” തിരഞ്ഞെടുക്കുക.",
    no: 'Forbindelsen mistet. Koble til på nytt ved å oppdatere denne siden. For å oppdatere, trykk bare på oppdateringsikonet ⟳ i adressefeltet. Eller trykk på adressen og trykk RETURN. Eller trykk på "..." eller "⋮" i menylinjen for å få en rullegardinmeny, og fra den velger du "Oppdater" eller "Last inn på nytt".',
    fa: "بیش از ۱۱۱ سانتیمتر، دسترسی به صفحه کلید کامپیوتر سخت‌تر می‌شود، بنابراین از صفحه کلید گوشی هوشمند خود استفاده کنید.",
    pl: "Połączenie utracone. Połącz się ponownie, odświeżając tę ​​stronę. Aby odświeżyć, po prostu dotknij ikony odświeżania ⟳ na pasku adresu. Możesz też dotknąć adresu i nacisnąć POWRÓT. Możesz też dotknąć „…” lub „⋮” na pasku menu, aby wyświetlić menu rozwijane, z którego wybierz „Odśwież” lub „Załaduj ponownie”.",
    pt: "Conexão perdida. Reconecte-se atualizando esta página. Para atualizar, basta tocar no ícone de atualização ⟳ na barra de endereço. Ou toque no endereço e pressione RETURN. Ou toque em “…” ou “⋮“ na barra de menu para obter um menu suspenso e selecione “Atualizar” ou “Recarregar”.",
    ro: "După 111 cm, este mai dificil să ajungi la tastatura calculatorului, așa că nu ezita să folosești tastatura de pe smartphone-ul tău în schimb.",
