    sr: "Preko 111 cm, teže je dosegnuti tastaturu računara, pa slobodno koristite tastaturu na svom pametnom telefonu umesto toga.",
    es: "Conexión perdida. Vuelva a conectar actualizando esta página. Para actualizar, simplemente toque el ícono de actualización ⟳ en la barra de direcciones. O toque la dirección y presione RETURN. O toque “…” o “⋮“ en la barra de menú para obtener un menú desplegable, y desde allí seleccione “Actualizar” o “Recargar”.",
