    hu: "Loading...",
    is: "Loading...",
    id: "Berpartisipasi dalam penelitian ini memungkinkan Anda memberikan kontribusi yang berarti terhadap kemajuan penelitian pendengaran online dengan menyediakan data penting tentang beragam mikrofon ponsel cerdas dan speaker komputer. Penelitian ini bertujuan untuk membuat perpustakaan rinci profil perangkat yang akan meningkatkan akurasi tes pendengaran yang dilakukan secara online.  Skema ini bergantung pada pencocokan mikrofon ponsel pengguna dengan mikrofon yang dikalibrasi di laboratorium. Setiap model memiliki mikrofon yang berbeda, jadi penting untuk menentukan modelnya. \nMemahami bahwa privasi adalah prioritas, yakinlah bahwa survei ini hanya menyimpan nomor model ponsel dan komputer. Nomor model ini tidak terkait dengan informasi pribadi apa pun dan tidak mengidentifikasi Anda. ",
    it: "Partecipare a questo studio ti consente di dare un contributo significativo all'avanzamento della ricerca sull'udito online fornendo dati essenziali sulla vasta gamma di microfoni per smartphone e altoparlanti per computer. Questa ricerca mira a creare una libreria dettagliata di profili dei dispositivi che migliorerà l'accuratezza dei test dell'udito condotti online. Il programma dipende dall'abbinamento del microfono del telefono dell'utente a un microfono calibrato in laboratorio. Ogni modello ha un microfono diverso, quindi è fondamentale specificare il modello. Comprendendo che la privacy è una priorità, ti assicuriamo che questo sondaggio conserva solo i numeri di modello di telefoni e computer. Questi numeri di modello non sono collegati a nessuna informazione personale e non ti identificano.",
    ja: "この研究に参加すると、さまざまなスマートフォンのマイクやコンピューターのスピーカーに関する重要なデータを提供することで、オンライン聴覚研究の進歩に有意義な貢献をすることができます。この研究は、オンラインで実施される聴力検査の精度を高めるデバイス プロファイルの詳細なライブラリを作成することを目的としています。  この方式は、ユーザーの電話マイクと研究室で調整されたマイクを一致させるかどうかに依存します。各モデルには異なるマイクが搭載されているため、モデルを指定することが重要です。 \nプライバシーが最優先であることをご理解いただき、この調査では携帯電話とコンピューターのモデル番号のみが保持されることをご安心ください。これらのモデル番号は個人情報に関連付けられておらず、お客様を特定するものではありません。 ",
