    el: "Loading...",
    he: 'האם טלפון הבדיקה מחובר לאינטרנט?\n1. כן, ולאחר מכן לחץ על אישור למטה כדי להמשיך.\n2. 📶 שירות סלולרי: אם השירות הסלולרי של הטלפון מתחבר לאינטרנט, לחץ על אישור.\n3. 🛜 WIFI: חבר אותו לאינטרנט באמצעות Wi-Fi ולחץ על אישור.\n4. הגדר שעה ותאריך: לטלפון חדש, או לטלפון ישן שאופס, אין חשבון שירות סלולרי ותאריך שגוי. לאחר שתגדיר את השעה והתאריך, זה יעבוד עם נקודה חמה/שיתוף אינטרנט, כפי שהוסבר בהמשך.\n5. HOTSPOT: אם הטלפון הנבדק אינו הטלפון האישי שלך, ולטלפון האישי שלך יש אינטרנט, שני הטלפונים יכולים לשתף גישה לאינטרנט. חבר את הטלפונים זה לזה באמצעות Wi-Fi, Bluetooth או USB:\n    * 🛜 נקודת Wi-Fi חמה: אם הטלפון האישי שלך מחובר לאינטרנט באמצעות שירות סלולרי, הוא יכול לספק נקודת Wi-Fi חמה לטלפון הבדיקה. לאחר החיבור, לחץ על אישור.\n    * >ᛒ שיתוף אינטרנט בין Bluetooth: אם הטלפון האישי שלך משתמש ב-Wi-Fi לגישה לאינטרנט, הוא יכול לשתף את הגישה לאינטרנט באמצעות Bluetooth. הפעל Bluetooth (ב-iPhone) או שיתוף אינטרנט בין Bluetooth (באנדרואיד) בשני הטלפונים, התאם אותם באמצעות Bluetooth ולחץ על אישור.\n    * שיתוף אינטרנט בין USB: אם שני הטלפונים הם מכשירי אייפון או ששני הטלפונים הם אנדרואידים, הם יכולים לשתף את הגישה לאינטרנט באמצעות כבל USB, אם יש לך את הכבל המתאים. כיום, רוב הטלפונים משתמשים במחבר USB-C, אבל האייפון 14 ואילך משתמשים במחבר Lightning. חבר את הטלפונים באמצעות הכבל המתאים ולחץ על אישור.\n6. ללא אינטרנט: אם אף אחת מהאפשרויות הללו לא זמינה, תחילה לחץ על אישור ולאחר מכן על "לא יכול להתחבר".',
    hi: 'क्या परीक्षण फ़ोन इंटरनेट से कनेक्ट है?\n1. हां, फिर आगे बढ़ने के लिए नीचे ओके पर क्लिक करें।\n2. 📶 सेल सेवा: यदि फ़ोन की सेल सेवा इंटरनेट से कनेक्ट होती है, तो ओके पर क्लिक करें।\n3. 🛜 वाईफ़ाई: इसे वाई-फाई के माध्यम से इंटरनेट से कनेक्ट करें और ओके पर क्लिक करें।\n4. समय और तारीख निर्धारित करें: एक नया फोन, या एक पुराना फोन जिसे रीसेट कर दिया गया है, उसमें कोई सेल सेवा खाता नहीं है और गलत तारीख है। एक बार जब आप समय और तारीख निर्धारित कर लेते हैं, तो यह हॉटस्पॉट/टेदरिंग के साथ काम करेगा, जैसा कि आगे बताया गया है।\n5. हॉटस्पॉट: यदि परीक्षण फ़ोन आपका व्यक्तिगत फ़ोन नहीं है, और आपके व्यक्तिगत फ़ोन में इंटरनेट है, तो दोनों फ़ोन इंटरनेट एक्सेस साझा कर सकते हैं। फ़ोनों को वाई-फ़ाई, ब्लूटूथ या USB द्वारा एक-दूसरे से कनेक्ट करें:\n    * 🛜 वाई-फाई हॉटस्पॉट: यदि आपका निजी फोन सेल सेवा के माध्यम से इंटरनेट से जुड़ा है, तो यह परीक्षण फोन पर वाई-फाई हॉटस्पॉट प्रदान कर सकता है। एक बार कनेक्ट होने पर, ओके पर क्लिक करें।\n    * >ब्लूटूथ टेथरिंग: यदि आपका निजी फोन इंटरनेट एक्सेस के लिए वाई-फाई का उपयोग कर रहा है, तो यह ब्लूटूथ के माध्यम से इंटरनेट एक्सेस साझा कर सकता है। दोनों फोन पर ब्लूटूथ (आईफोन पर) या ब्लूटूथ टेदरिंग (एंड्रॉइड पर) सक्षम करें, उन्हें ब्लूटूथ के जरिए पेयर करें और ओके पर क्लिक करें।\n    * यूएसबी टेथरिंग: यदि दोनों फोन आईफोन हैं या दोनों फोन एंड्रॉइड हैं, तो यदि आपके पास सही केबल है, तो वे यूएसबी केबल के माध्यम से इंटरनेट एक्सेस साझा कर सकते हैं। आज, अधिकांश फ़ोन USB-C कनेक्टर का उपयोग करते हैं, लेकिन iPhone 14 और इससे पहले के फ़ोन लाइटनिंग कनेक्टर का उपयोग करते हैं। फ़ोन को उपयुक्त केबल के माध्यम से कनेक्ट करें और ओके पर क्लिक करें।\n6. कोई इंटरनेट नहीं: यदि इनमें से कोई भी विकल्प उपलब्ध नहीं है, तो पहले ओके पर क्लिक करें और फिर "कनेक्ट नहीं हो सकता" पर क्लिक करें।',
