    ar: "وإلا: إذا لم يتعرف الكاميرا على رمز الاستجابة السريعة، فقط انسخ xxx في متصفح هاتفك واضغط على زر الذهاب في المتصفح. يجب أن تتقدم هذه الصفحة بعد ذلك. إذا لم يحدث ذلك، فقم بـ LLL، وحاول مرة أخرى. إذا فشل ذلك، انقر على زر لا يمكن. أخيرًا، إذا لم يكن هناك هاتف ذكي متاح، انقر على زر لا يوجد هاتف ذكي.",
