    it: "ALTRIMENTI: Se la tua fotocamera non riconosce il codice QR, copia semplicemente xxx nel browser del tuo telefono e tocca il pulsante VAI del browser. Questa pagina dovrebbe quindi avanzare. In caso contrario, allora LLL, e riprova. Se anche questo non funziona, fai clic sul pulsante NON POSSO. Infine, se non hai uno smartphone a portata di mano, fai clic su NESSUNO SMARTPHONE.",
    ja: "さもないと：\nカメラが QR コードを認識しない場合は、コピーしてください\nxxx\n携帯電話のブラウザに入力し、ブラウザの [GO] ボタンをタップします。このページは次に進みます。\nそうでない場合は、LLL を実行して、再試行してください。\nそれができない場合は、「CAN'T」ボタンをクリックしてください。\n最後に、スマートフォンが手元にない場合は、「スマートフォンなし」をクリックします。",
    kn: "ಇಲ್ಲದಿದ್ದರೆ:\nನಿಮ್ಮ ಕ್ಯಾಮರಾ QR ಕೋಡ್ ಅನ್ನು ಗುರುತಿಸದಿದ್ದರೆ, ನಕಲಿಸಿ\nxxx\nನಿಮ್ಮ ಫೋನ್ ಬ್ರೌಸರ್‌ನಲ್ಲಿ ಮತ್ತು ಬ್ರೌಸರ್‌ನ GO ಬಟನ್ ಟ್ಯಾಪ್ ಮಾಡಿ. ಈ ಪುಟವು ನಂತರ ಮುಂದುವರಿಯಬೇಕು.\nಇಲ್ಲದಿದ್ದರೆ, ನಂತರ LLL, ಮತ್ತು ಮತ್ತೆ ಪ್ರಯತ್ನಿಸಿ.\nಅದು ವಿಫಲವಾದರೆ, CAN'T ಬಟನ್ ಕ್ಲಿಕ್ ಮಾಡಿ.\nಅಂತಿಮವಾಗಿ, ಯಾವುದೇ ಸ್ಮಾರ್ಟ್‌ಫೋನ್ ಸೂಕ್ತವಾಗಿಲ್ಲದಿದ್ದರೆ, ಸ್ಮಾರ್ಟ್‌ಫೋನ್ ಇಲ್ಲ ಕ್ಲಿಕ್ ಮಾಡಿ.",
    ko: "그렇지 않으면:\n카메라가 QR 코드를 인식하지 못하는 경우 복사하세요.\n트리플 엑스\n휴대폰 브라우저에 접속하여 브라우저의 GO 버튼을 탭하세요. 그러면 이 페이지가 진행됩니다.\n그렇지 않은 경우 LLL을 수행하고 다시 시도하십시오.\n실패하면 CAN'T 버튼을 클릭하세요.\n마지막으로, 편리한 스마트폰이 없으면 NO SMARTPHONE(스마트폰 없음)을 클릭하세요.",
    lt: "KITAIP:\nJei fotoaparatas neatpažįsta QR kodo, tiesiog nukopijuokite\nxxx\nį savo telefono naršyklę ir bakstelėkite naršyklės mygtuką EITI. Tada šis puslapis turėtų judėti pirmyn.\nJei ne, tada LLL ir bandykite dar kartą.\nJei to nepadarysite, spustelėkite mygtuką NEGALIMA.\nGaliausiai, jei nėra po ranka jokio išmaniojo telefono, spustelėkite NO SMARTPHONE.",
    ms: "SELAINNYA:\nJika kamera anda tidak mengenali kod QR, salin sahaja\nxxx\nke dalam penyemak imbas telefon anda dan ketik butang GO penyemak imbas. Halaman ini kemudiannya harus maju.\nJika tidak, maka LLL, dan cuba lagi.\nJika gagal, klik butang TIDAK BOLEH.\nAkhir sekali, jika tiada telefon pintar yang berguna, klik NO SMARTPHONE.",
    ml: "അല്ലാത്തപക്ഷം:\nനിങ്ങളുടെ ക്യാമറ QR കോഡ് തിരിച്ചറിയുന്നില്ലെങ്കിൽ, പകർത്തുക\nxxx\nനിങ്ങളുടെ ഫോൺ ബ്രൗസറിൽ കയറി ബ്രൗസറിൻ്റെ GO ബട്ടൺ ടാപ്പ് ചെയ്യുക. തുടർന്ന് ഈ പേജ് മുന്നോട്ട് പോകണം.\nഇല്ലെങ്കിൽ, LLL, വീണ്ടും ശ്രമിക്കുക.\nപരാജയപ്പെട്ടാൽ, CAN'T ബട്ടണിൽ ക്ലിക്ക് ചെയ്യുക.\nഅവസാനമായി, ഒരു സ്‌മാർട്ട്‌ഫോണും ലഭ്യമല്ലെങ്കിൽ, സ്‌മാർട്ട്‌ഫോൺ വേണ്ട എന്നതിൽ ക്ലിക്ക് ചെയ്യുക.",
    no: "NOE ANNET:\nHvis kameraet ditt ikke gjenkjenner QR-koden, er det bare å kopiere\nxxx\ninn i telefonens nettleser og trykk på nettleserens GO-knapp. Denne siden bør deretter gå videre.\nHvis ikke, så LLL, og prøv igjen.\nHvis du ikke gjør det, klikker du på KAN IKKE-knappen.\nTil slutt, hvis ingen smarttelefon er tilgjengelig, klikker du på INGEN SMARTPHONE.",
