    fa: "بیش از ۱۱۱ سانتیمتر، دسترسی به صفحه کلید کامپیوتر سخت‌تر می‌شود، بنابراین از صفحه کلید گوشی هوشمند خود استفاده کنید.",
    pl: "OK. Możesz ukończyć to badanie bez podłączania telefonu. Jednak w naszym następnym badaniu do kalibracji głośnika potrzebny jest telefon, co wymaga połączenia. Chcielibyśmy powitać jak najwięcej uczestników w tym przyszłym badaniu. Czy możesz pomóc nam zrozumieć Twoje obawy?",
    pt: "Loading...",
    ro: "După 111 cm, este mai dificil să ajungi la tastatura calculatorului, așa că nu ezita să folosești tastatura de pe smartphone-ul tău în schimb.",
    ru: "За пределами 111 см становится сложнее достать до клавиатуры компьютера, поэтому не стесняйтесь использовать клавиатуру на своем смартфоне вместо этого.",
    sr: "Preko 111 cm, teže je dosegnuti tastaturu računara, pa slobodno koristite tastaturu na svom pametnom telefonu umesto toga.",
    es: "Está bien. Puedes completar este estudio sin conectar tu teléfono. Sin embargo, nuestro próximo estudio utiliza el teléfono para calibrar el altavoz, lo que requiere conexión. Nos gustaría dar la bienvenida a tantos participantes como sea posible en ese estudio futuro. ¿Puedes ayudarnos a entender tu preocupación?",
    sw: "Sawa. Unaweza kukamilisha utafiti huu bila kuunganisha simu yako. Hata hivyo, somo letu linalofuata linatumia simu kurekebisha kipaza sauti, ambacho kinahitaji muunganisho. Tungependa kuwakaribisha washiriki wengi iwezekanavyo katika utafiti huo ujao. Je, unaweza kutusaidia kuelewa wasiwasi wako?",
    sv: "Ok. Du kan slutföra denna studie utan att ansluta din telefon. Men vår nästa studie använder telefonen för att kalibrera högtalaren, vilket kräver anslutning. Vi vill välkomna så många deltagare som möjligt i den framtida studien. Kan du hjälpa oss att förstå din oro?",
    tl: "Sa higit sa 111 cm, mas mahirap na maabot ang keyboard ng iyong computer, kaya maaari kang gumamit ng keypad sa iyong smartphone sa halip.",
    tr: "Tamam. Bu çalışmayı telefonunuzu bağlamadan tamamlayabilirsiniz. Ancak bir sonraki çalışmamızda, bağlantı gerektiren hoparlörü kalibre etmek için telefon kullanılıyor. Gelecek çalışmada mümkün olduğu kadar çok katılımcıyı ağırlamak istiyoruz. Endişenizi anlamamıza yardımcı olabilir misiniz?",
