    kn: "1. ಪ್ರಾಯೋಗಿಕ ಶಬ್ದಗಳನ್ನು ರೆಕಾರ್ಡ್ ಮಾಡುವ ಮೊದಲು, ನಾವು ಹಿನ್ನೆಲೆ ಧ್ವನಿ ಮಟ್ಟವನ್ನು ಅಳೆಯಬೇಕು.\n2. ರೆಕಾರ್ಡಿಂಗ್ ಸಮಯದಲ್ಲಿ ದಯವಿಟ್ಟು ಮೌನವನ್ನು ಕಾಪಾಡಿಕೊಳ್ಳಿ.\n3. ಸಿದ್ಧವಾದಾಗ, ರೆಕಾರ್ಡ್ ಕ್ಲಿಕ್ ಮಾಡಿ.",
