    lt: "1. Prieš įrašydami eksperimentinius garsus, turime išmatuoti foninio garso lygį.\n2. Įrašymo metu tylėkite.\n3. Kai būsite pasiruošę, spustelėkite Įrašyti.",
    ms: "1. Sebelum merakam bunyi eksperimen, kita perlu mengukur tahap bunyi latar belakang.\n2. Sila kekalkan senyap semasa rakaman.\n3. Apabila bersedia, klik Rekod.",
    ml: "1. പരീക്ഷണ ശബ്‌ദങ്ങൾ റെക്കോർഡുചെയ്യുന്നതിന് മുമ്പ്, ഞങ്ങൾ പശ്ചാത്തല ശബ്‌ദ നില അളക്കേണ്ടതുണ്ട്.\n2. റെക്കോർഡിംഗ് സമയത്ത് ദയവായി നിശബ്ദത പാലിക്കുക.\n3. തയ്യാറാകുമ്പോൾ, റെക്കോർഡ് ക്ലിക്ക് ചെയ്യുക.",
    no: "1. Før vi tar opp de eksperimentelle lydene, må vi måle bakgrunnslydnivået.\n2. Vennligst hold stillhet under opptaket.\n3. Når du er klar, klikk på Record.",
