    lt: "Loading...",
    ms: "Di luar 111 cm, lebih sulit untuk mencapai papan ketik komputer Anda, jadi silakan gunakan keypad di smartphone Anda sebagai gantinya.",
    ml: "ഈ സ്ക്രീനിൻ്റെ വലിപ്പം ഞങ്ങൾ അളക്കും. സൗകര്യപ്രദമായ എന്തെങ്കിലും തിരഞ്ഞെടുക്കാൻ പുൾ-ഡൗൺ മെനു ഉപയോഗിക്കുക. നിങ്ങൾക്ക് ഏതെങ്കിലും സാധാരണ USB കണക്ടറോ (നിങ്ങളുടെ കമ്പ്യൂട്ടറിന് പവർ നൽകുന്നതുൾപ്പെടെ) അല്ലെങ്കിൽ ഒരു ക്രെഡിറ്റ് കാർഡോ (അല്ലെങ്കിൽ അതേ വലിപ്പത്തിലുള്ള ഏതെങ്കിലും കാർഡ്) ഉപയോഗിക്കാം. നിങ്ങളുടെ ഒബ്‌ജക്‌റ്റ് സ്‌ക്രീനിൽ വയ്ക്കുക, നിങ്ങളുടെ ഒബ്‌ജക്‌റ്റിൻ്റെ വലുപ്പവുമായി പൊരുത്തപ്പെടുന്നതിന് ചിത്രം ക്രമീകരിക്കുന്നതിന് സ്ലൈഡർ നീക്കുക. അവ പൊരുത്തപ്പെടുമ്പോൾ, തുടരാൻ RETURN അമർത്തുക (അല്ലെങ്കിൽ ശരി ക്ലിക്കുചെയ്യുക).",
    no: "Vi vil måle størrelsen på denne skjermen. Bruk rullegardinmenyen for å velge noe praktisk. Du kan bruke en hvilken som helst vanlig USB-kontakt (inkludert den som gir strøm til datamaskinen din) eller et kredittkort (eller et hvilket som helst kort av samme størrelse). Plasser objektet på skjermen og flytt glidebryteren for å justere bildet slik at det passer med objektets størrelse. Når de samsvarer, trykk RETURN (eller klikk OK) for å fortsette.",
    fa: "بیش از ۱۱۱ سانتیمتر، دسترسی به صفحه کلید کامپیوتر سخت‌تر می‌شود، بنابراین از صفحه کلید گوشی هوشمند خود استفاده کنید.",
    pl: "Zmierzymy rozmiar tego ekranu. Użyj menu rozwijanego, aby wybrać coś przydatnego. Możesz użyć dowolnego popularnego złącza USB (w tym tego, które zasila komputer) lub karty kredytowej (lub dowolnej karty o tym samym rozmiarze). Umieść obiekt na ekranie i przesuń suwak, aby dostosować obraz do rozmiaru obiektu. Kiedy pasują, naciśnij RETURN (lub kliknij OK), aby kontynuować.",
    pt: "Mediremos o tamanho desta tela. Use o menu suspenso para escolher algo útil. Você pode usar qualquer conector USB comum (incluindo aquele que fornece energia ao seu computador) ou um cartão de crédito (ou qualquer cartão do mesmo tamanho). Coloque o seu objeto na tela e mova o controle deslizante para ajustar a imagem de acordo com o tamanho do seu objeto. Quando corresponderem, pressione RETURN (ou clique em OK) para prosseguir.",
    ro: "După 111 cm, este mai dificil să ajungi la tastatura calculatorului, așa că nu ezita să folosești tastatura de pe smartphone-ul tău în schimb.",
    ru: "За пределами 111 см становится сложнее достать до клавиатуры компьютера, поэтому не стесняйтесь использовать клавиатуру на своем смартфоне вместо этого.",
    sr: "Preko 111 cm, teže je dosegnuti tastaturu računara, pa slobodno koristite tastaturu na svom pametnom telefonu umesto toga.",
    es: "Mediremos el tamaño de esta pantalla. Usa el menú desplegable para elegir algo práctico. Puedes usar cualquier conector USB común (incluido el que proporciona energía a tu computadora) o una tarjeta de crédito (o cualquier tarjeta del mismo tamaño). Coloca tu objeto en la pantalla y mueve el control deslizante para ajustar la imagen al tamaño de tu objeto. Cuando coincidan, presiona RETURN (o haz clic en OK) para continuar.",
    sw: "Tutapima ukubwa wa skrini hii. Tumia menyu ya kuvuta-chini ili kuchagua kitu kinachofaa. Unaweza kutumia kiunganishi chochote cha kawaida cha USB (pamoja na kile kinachotoa nishati kwa kompyuta yako) au kadi ya mkopo (au kadi yoyote ya ukubwa sawa). Weka kitu chako kwenye skrini na usogeze kitelezi ili kurekebisha picha ili ilingane na saizi ya kitu chako. Zinapolingana, bonyeza RETURN (au bofya SAWA) ili kuendelea.",
    sv: "Vi kommer att mäta storleken på denna skärm. Använd rullgardinsmenyn för att välja något praktiskt. Du kan använda vilken vanlig USB-kontakt som helst (inklusive den som ger ström till din dator) eller ett kreditkort (eller vilket kort som helst av samma storlek). Placera ditt objekt på skärmen och flytta reglaget för att justera bilden så att den matchar ditt objekts storlek. När de matchar, tryck på RETURN (eller klicka på OK) för att fortsätta.",
    tl: "Sa higit sa 111 cm, mas mahirap na maabot ang keyboard ng iyong computer, kaya maaari kang gumamit ng keypad sa iyong smartphone sa halip.",
