    pl: "Dzięki. Głośnik jest teraz skalibrowany i smartfon można odłożyć. WAŻNE: NIE DOTYKAJ REGULACJI GŁOŚNOŚCI, dopóki eksperyment nie zostanie zakończony. Zmiana głośności zniszczy kalibrację głośnika i unieważni wszystkie wyniki. ",
    pt: "Obrigado. O alto-falante agora está calibrado e você pode guardar o smartphone. IMPORTANTE: NÃO TOQUE NO CONTROLE DE VOLUME até que o experimento seja concluído. Alterar o volume arruinará a calibração do alto-falante e invalidará todos os resultados. ",
