    he: "תוֹדָה. הרמקול מכויל כעת, וניתן להניח את הסמארטפון (או מיקרופון USB). חשוב: אל תיגע בבקרת עוצמת הקול עד לסיום הניסוי. שינוי עוצמת הקול יהרוס את כיול הרמקול ותבטל את כל התוצאות. ",
    hi: "धन्यवाद। लाउडस्पीकर अब कैलिब्रेटेड है, और आप स्मार्टफोन (या यूएसबी माइक्रोफोन) को दूर रख सकते हैं। महत्वपूर्ण: प्रयोग पूरा होने तक वॉल्यूम नियंत्रण को न छुएं। वॉल्यूम बदलने से लाउडस्पीकर का कैलिब्रेशन खराब हो जाएगा और सभी परिणाम अमान्य हो जाएंगे। ",
    hu: "Köszönöm. A hangszóró kalibrálva van, és elteheti az okostelefont (vagy USB-mikrofont). FONTOS: NE ÉRINTSE MEG A HANGERŐSZABÁLYOZÓT, amíg a kísérlet be nem fejeződik. A hangerő megváltoztatása tönkreteszi a hangszóró kalibrálását, és érvényteleníti az összes eredményt. ",
    is: "Takk. Hátalarinn er nú kvarðaður og þú getur lagt frá þér snjallsímann (eða USB hljóðnema). MIKILVÆGT: EKKI SNERTA RÁÐSTJÓRNIN fyrr en tilrauninni er lokið. Að breyta hljóðstyrknum mun eyðileggja hátalarakvörðunina og ógilda allar niðurstöður. ",
    id: "Terima kasih. Loudspeaker kini telah dikalibrasi, dan Anda dapat menyimpan ponsel cerdas (atau mikrofon USB). PENTING: JANGAN SENTUH KONTROL VOLUME sampai percobaan selesai. Mengubah volume akan merusak kalibrasi loudspeaker dan membuat semua hasil tidak valid. ",
    it: "Grazie. L'altoparlante è ora calibrato e puoi riporre lo smartphone (o il microfono USB). IMPORTANTE: NON TOCCARE IL CONTROLLO DEL VOLUME fino a quando l'esperimento non è terminato. Cambiare il volume rovinerà la calibrazione dell'altoparlante e invaliderà tutti i risultati.",
    ja: "Loading...",
    kn: "ಧನ್ಯವಾದಗಳು. ಧ್ವನಿವರ್ಧಕವನ್ನು ಈಗ ಮಾಪನಾಂಕ ಮಾಡಲಾಗಿದೆ, ಮತ್ತು ನೀವು ಸ್ಮಾರ್ಟ್‌ಫೋನ್ (ಅಥವಾ USB ಮೈಕ್ರೊಫೋನ್) ಅನ್ನು ದೂರ ಇಡಬಹುದು. ಪ್ರಮುಖ: ಪ್ರಯೋಗ ಮುಗಿಯುವವರೆಗೆ ವಾಲ್ಯೂಮ್ ಕಂಟ್ರೋಲ್ ಅನ್ನು ಸ್ಪರ್ಶಿಸಬೇಡಿ. ವಾಲ್ಯೂಮ್ ಅನ್ನು ಬದಲಾಯಿಸುವುದರಿಂದ ಧ್ವನಿವರ್ಧಕ ಮಾಪನಾಂಕ ನಿರ್ಣಯವನ್ನು ಹಾಳುಮಾಡುತ್ತದೆ ಮತ್ತು ಎಲ್ಲಾ ಫಲಿತಾಂಶಗಳನ್ನು ಅಮಾನ್ಯಗೊಳಿಸುತ್ತದೆ. ",
    ko: "감사해요. 이제 스피커가 보정되었으므로 스마트폰(또는 USB 마이크)을 치울 수 있습니다. 중요: 실험이 완료될 때까지 볼륨 컨트롤을 만지지 마십시오. 볼륨을 변경하면 라우드스피커 보정이 손상되고 모든 결과가 무효화됩니다. ",
    lt: "Ačiū. Garsiakalbis dabar sukalibruotas ir galite padėti išmanųjį telefoną (arba USB mikrofoną). SVARBU: NELIESKITE GARSUMO VALDYMO, kol nebus atliktas eksperimentas. Garsumo pakeitimas sugadins garsiakalbio kalibravimą ir panaikins visus rezultatus. ",
