    ar: "لإنتاج صوت دقيق، يحتاج التجربة إلى معايرة مكبرات الصوت. يتطلب ذلك هاتفًا ذكيًا متصلًا بالإنترنت. هل لديك واحد في متناول اليد؟",
    hy: "Ճշգրիտ ձայն արտադրելու համար փորձը պետք է չափորոշի բարձրախոսները: Սա պահանջում է ինտերնետին միացված սմարթֆոն: Դուք ունե՞ք մեկ հարմար: \n",
    bg: "За да произведе точен звук, експериментът трябва да калибрира високоговорителите. Това изисква смартфон, свързан с интернет. Имате ли подръка? \n",
    "zh-CN": "Loading...",
    "zh-HK":
      "為了產生準確的聲音，實驗需要校準揚聲器。這需要連接到網路的智慧型手機。你手邊有一個嗎？ \n",
    hr: "Da bi proizveli točan zvuk, eksperiment mora kalibrirati zvučnike. Za to je potreban pametni telefon povezan s internetom. Imate li jedan pri ruci? \n",
    cs: "Loading...",
    da: "Loading...",
    nl: "Om nauwkeurig geluid te produceren, moet het experiment de luidsprekers kalibreren. Hiervoor is een smartphone nodig die verbonden is met internet. Heb je er eentje bij de hand? \n",
    "en-UK":
      "To produce accurate sound, the experiment needs to calibrate the loudspeakers. This requires a smartphone connected to the internet. Do you have one to hand?",
    fi: "Tarkan äänen tuottamiseksi kokeessa on kalibroitava kaiuttimet. Tämä vaatii älypuhelimen, joka on yhdistetty Internetiin. Onko sinulla yksi kätevä? \n",
    fr: "Pour produire un son précis, l'expérience doit calibrer les haut-parleurs. Cela nécessite un smartphone connecté à Internet. En avez-vous un à portée de main ?",
    de: "Um einen präzisen Klang zu erzeugen, müssen die Lautsprecher im Experiment kalibriert werden. Hierzu ist ein mit dem Internet verbundenes Smartphone erforderlich. Haben Sie eines zur Hand? \n",
    el: "Για να παράγει ακριβή ήχο, το πείραμα πρέπει να βαθμονομήσει τα μεγάφωνα. Αυτό απαιτεί ένα smartphone συνδεδεμένο στο Διαδίκτυο. Έχετε ένα εύχρηστο; \n",
    he: "כדי להפיק צליל מדויק, הניסוי צריך לכייל את הרמקולים. זה דורש סמארטפון מחובר לאינטרנט. יש לך אחד שימושי? \n",
    hi: "Loading...",
    hu: "A pontos hangzás érdekében a kísérlet során kalibrálni kell a hangszórókat. Ehhez internethez csatlakoztatott okostelefonra van szükség. Van egy kéznél? \n",
    is: "Til að framleiða nákvæmt hljóð þarf tilraunin að kvarða hátalarana. Til þess þarf snjallsíma sem er tengdur við internetið. Ertu með einn við höndina? \n",
    id: "Loading...",
    it: "Per produrre un suono accurato, l'esperimento deve calibrare gli altoparlanti. Questo richiede uno smartphone connesso a Internet. Ne hai uno a portata di mano?",
    ja: "正確なサウンドを生成するには、実験でスピーカーを調整する必要があります。これにはインターネットに接続されたスマートフォンが必要です。お手元にありますか？ \n",
    kn: "ನಿಖರವಾದ ಧ್ವನಿಯನ್ನು ಉತ್ಪಾದಿಸಲು, ಪ್ರಯೋಗವು ಧ್ವನಿವರ್ಧಕಗಳನ್ನು ಮಾಪನಾಂಕ ನಿರ್ಣಯಿಸುವ ಅಗತ್ಯವಿದೆ. ಇದಕ್ಕೆ ಇಂಟರ್ನೆಟ್‌ಗೆ ಸಂಪರ್ಕಗೊಂಡಿರುವ ಸ್ಮಾರ್ಟ್‌ಫೋನ್ ಅಗತ್ಯವಿದೆ. ನಿಮ್ಮ ಬಳಿ ಒಂದು ಕೈವಾಡವಿದೆಯೇ? \n",
    ko: "Loading...",
    lt: "Loading...",
    ms: "Di luar 111 cm, lebih sulit untuk mencapai papan ketik komputer Anda, jadi silakan gunakan keypad di smartphone Anda sebagai gantinya.",
    ml: "കൃത്യമായ ശബ്ദം പുറപ്പെടുവിക്കുന്നതിന്, പരീക്ഷണത്തിന് ഉച്ചഭാഷിണികൾ കാലിബ്രേറ്റ് ചെയ്യേണ്ടതുണ്ട്. ഇതിന് ഇൻ്റർനെറ്റുമായി ബന്ധിപ്പിച്ചിട്ടുള്ള ഒരു സ്മാർട്ട്ഫോൺ ആവശ്യമാണ്. നിങ്ങളുടെ കൈയ്യിൽ ഒന്ന് ഉണ്ടോ? \n",
    no: "For å produsere nøyaktig lyd, må eksperimentet kalibrere høyttalerne. Dette krever en smarttelefon koblet til internett. Har du en hendig? \n",
    fa: "بیش از ۱۱۱ سانتیمتر، دسترسی به صفحه کلید کامپیوتر سخت‌تر می‌شود، بنابراین از صفحه کلید گوشی هوشمند خود استفاده کنید.",
    pl: "Aby uzyskać dokładny dźwięk, w eksperymencie należy skalibrować głośniki. Wymaga to smartfona podłączonego do Internetu. Czy masz taki pod ręką? \n",
    pt: "Para produzir um som preciso, o experimento precisa calibrar os alto-falantes. Isso requer um smartphone conectado à internet. Você tem um em mãos? \n",
    ro: "După 111 cm, este mai dificil să ajungi la tastatura calculatorului, așa că nu ezita să folosești tastatura de pe smartphone-ul tău în schimb.",
    ru: "За пределами 111 см становится сложнее достать до клавиатуры компьютера, поэтому не стесняйтесь использовать клавиатуру на своем смартфоне вместо этого.",
    sr: "Preko 111 cm, teže je dosegnuti tastaturu računara, pa slobodno koristite tastaturu na svom pametnom telefonu umesto toga.",
    es: "Para producir un sonido preciso, el experimento necesita calibrar los altavoces. Esto requiere un teléfono inteligente conectado a internet. ¿Tienes uno a mano?",
    sw: "Ili kutoa sauti sahihi, jaribio linahitaji kurekebisha vipaza sauti. Hii inahitaji simu mahiri iliyounganishwa kwenye mtandao. Je! una mkono mmoja? \n",
