    it: "A LUNGHE DISTANZE, UTILIZZERAI IL TUO TELEFONO COME TASTIERA. Collegalo ora per usarlo più tardi. Punta la fotocamera del tuo smartphone su questo codice QR. Quindi tocca il link che appare sullo schermo del tuo smartphone.",
