    ko: "Loading...",
    lt: "Loading...",
    ms: "PADA JARAK JAUH, ANDA AKAN MENGGUNAKAN TELEFON ANDA SEBAGAI KEYPAD. Sambungkannya sekarang untuk digunakan kemudian. Halakan kamera telefon pintar anda pada kod QR ini. Kemudian ketik pautan yang muncul pada skrin telefon pintar anda.",
    ml: "ദീർഘദൂരങ്ങളിൽ, നിങ്ങൾ നിങ്ങളുടെ ഫോൺ ഒരു കീപാഡായി ഉപയോഗിക്കും. പിന്നീട് ഉപയോഗിക്കുന്നതിന് ഇപ്പോൾ ഇത് ബന്ധിപ്പിക്കുക. ഈ QR കോഡിലേക്ക് നിങ്ങളുടെ സ്‌മാർട്ട്‌ഫോൺ ക്യാമറ പോയിൻ്റ് ചെയ്യുക. തുടർന്ന് നിങ്ങളുടെ സ്മാർട്ട്ഫോൺ സ്ക്രീനിൽ ദൃശ്യമാകുന്ന ലിങ്കിൽ ടാപ്പ് ചെയ്യുക.",
    no: "PÅ LANGE AVSTAND BRUKER DU TELEFONEN SOM ET TASTATUR. Koble den til nå for senere bruk. Pek smarttelefonkameraet mot denne QR-koden. Trykk deretter på koblingen som vises på smarttelefonskjermen.",
