    ru: "НА БОЛЬШИХ РАССТОЯНИЯХ ВЫ БУДЕТЕ ИСПОЛЬЗОВАТЬ ТЕЛЕФОН КАК КЛАВИАТУРУ. Подключите его сейчас, чтобы использовать позже. Наведите камеру смартфона на этот QR-код. Затем коснитесь ссылки, которая появится на экране вашего смартфона.",
